import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../../context/AuthContext';
import { useTheme } from '../../context/ThemeContext';

const Navbar = () => {
  const { user, logout } = useAuth();
  const { isDark, toggleTheme } = useTheme();
  const navigate = useNavigate();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const handleLogout = () => {
    logout();
    navigate('/login');
    setIsMobileMenuOpen(false);
  };

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <nav className="navbar">
      <div className="navbar-content">
        <Link to="/" className="navbar-brand">
          <div style={{ display: 'flex', alignItems: 'center', gap: '0.5rem' }}>
            <div style={{
              width: '2rem',
              height: '2rem',
              background: 'linear-gradient(135deg, #3498db, #2980b9)',
              borderRadius: '0.5rem',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center'
            }}>
              <svg style={{ width: '1.25rem', height: '1.25rem', color: 'white' }} fill="currentColor" viewBox="0 0 20 20">
                <path d="M2 5a2 2 0 012-2h7a2 2 0 012 2v4a2 2 0 01-2 2H9l-3 3v-3H4a2 2 0 01-2-2V5z" />
                <path d="M15 7v2a4 4 0 01-4 4H9.828l-1.766 1.767c.28.149.599.233.938.233h2l3 3v-3h2a2 2 0 002-2V9a2 2 0 00-2-2h-1z" />
              </svg>
            </div>
            TicketPro
          </div>
        </Link>
        
        {user && (
          <button 
            className="mobile-menu-toggle"
            onClick={toggleMobileMenu}
            aria-label="Toggle mobile menu"
          >
            ‚ò∞
          </button>
        )}
        
        <div className="navbar-nav">
          {user ? (
            <>
              <Link to="/dashboard" className="nav-link">
                Dashboard
              </Link>
              {user.role === 'customer' && (
                <Link to="/tickets/new" className="nav-link">
                  New Ticket
                </Link>
              )}
              
              {/* Theme Toggle */}
              <button
                onClick={toggleTheme}
                className="nav-link"
                style={{ background: 'none', border: 'none', cursor: 'pointer' }}
                aria-label="Toggle theme"
              >
                {isDark ? '‚òÄÔ∏è' : 'üåô'}
              </button>

              <span className="nav-link">
                {user.name} ({user.role})
              </span>
              <button onClick={handleLogout} className="btn-logout">
                Logout
              </button>
            </>
          ) : (
            <>
              <Link to="/login" className="nav-link">
                Login
              </Link>
              <Link to="/register" className="nav-link">
                Register
              </Link>
            </>
          )}
        </div>
        
        {/* Mobile Menu */}
        {user && (
          <div className={`mobile-menu ${isMobileMenuOpen ? 'active' : ''}`}>
            <Link to="/dashboard" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>
              Dashboard
            </Link>
            {user.role === 'customer' && (
              <Link to="/tickets/new" className="nav-link" onClick={() => setIsMobileMenuOpen(false)}>
                New Ticket
              </Link>
            )}
            <span className="nav-link">
              Welcome, {user.name}
            </span>
            <span className="nav-link" style={{ fontSize: '0.8rem', opacity: 0.8 }}>
              Role: {user.role}
            </span>
            <button onClick={handleLogout} className="btn-logout" style={{ marginTop: '1rem' }}>
              Logout
            </button>
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
